import React, { Component } from "react";

class DashRecipes extends Component {
  state = {
    recipes: 2,
  };

  render() {
    return (
      <div className="dashOutlineWrapper">
        <div className="dashOutlineHeader">My recipes</div>
        <div>{this.checkRecipe}</div>
      </div>
    );
  }
}

export default DashRecipes;
